	public static void createZip(String module, Boolean isPublic, String folderName) throws EndlosException {
		File file = new File(SettingModel.getFilePath() + File.separator + module + File.separator + folderName);
		if (!file.exists()) {
			throw new EndlosException(ResponseCode.FILE_NOT_FOUND.getCode(), ResponseCode.FILE_NOT_FOUND.getMessage());
		}
		makeZipFile(file);
	}

	private static void makeZipFile(File file) throws EndlosException {
		List<String> fileList = new ArrayList<String>();
		final String OUTPUT_ZIP_FILE = file.getAbsolutePath() + ".zip";
		final String SOURCE_FOLDER = file.getAbsolutePath();
		generateFileList(file, fileList, SOURCE_FOLDER);
		zipIt(OUTPUT_ZIP_FILE, fileList, SOURCE_FOLDER);
	}

	public static void zipIt(String zipFile, List<String> fileList, String SOURCE_FOLDER) throws EndlosException {
		byte[] buffer = new byte[1024];
		String source = new File(SOURCE_FOLDER).getName();
		FileOutputStream fos = null;
		ZipOutputStream zos = null;
		try {
			fos = new FileOutputStream(zipFile);
			zos = new ZipOutputStream(fos);

			System.out.println("Output to Zip : " + zipFile);
			FileInputStream in = null;

			for (String file : fileList) {
				System.out.println("File Added : " + file);
				ZipEntry ze = new ZipEntry(source + File.separator + file);
				zos.putNextEntry(ze);
				try {
					in = new FileInputStream(SOURCE_FOLDER + File.separator + file);
					int len;
					while ((len = in.read(buffer)) > 0) {
						zos.write(buffer, 0, len);
					}
				} finally {
					in.close();
				}
			}

			zos.closeEntry();
			System.out.println("Folder successfully compressed");

		} catch (IOException ex) {
			LoggerService.exception(ex);
			throw new EndlosException(ResponseCode.UNABLE_TO_CREATE_ZIP.getCode(),
					ResponseCode.UNABLE_TO_CREATE_ZIP.getMessage());
		} finally {
			try {
				zos.close();
			} catch (IOException e) {
				LoggerService.exception(e);
				throw new EndlosException(ResponseCode.UNABLE_TO_CREATE_ZIP.getCode(),
						ResponseCode.UNABLE_TO_CREATE_ZIP.getMessage());
			}
		}
	}

	public static void generateFileList(File node, List<String> fileList, String SOURCE_FOLDER) {
		// add file only
		if (node.isFile()) {
			fileList.add(generateZipEntry(node.toString(), SOURCE_FOLDER));
		}

		if (node.isDirectory()) {
			String[] subNote = node.list();
			for (String filename : subNote) {
				generateFileList(new File(node, filename), fileList, SOURCE_FOLDER);
			}
		}
	}

	private static String generateZipEntry(String file, String path) {
		return file.substring(path.length() - 1, file.length());
	}

